Nebenher beschäftige ich mich mit (link: /blog/tags:politik text: Politik), (link: /blog/tags:code text: Code) und (link: /blog/tags:weltretten text: Weltretten) und schreibe über das was mir gerade in den sinn kommt.

Blogposts erscheinen seit 2012 ca. alle 14 Tage.

Ihr erreicht mich auf (link: http://www.twitter.com/DerZyklop text: Twitter) und per (email: mail@der-zyklop.de text: Email).

Code gibts auf (link: https://github.com/DerZyklop text: github)

Falls ihr mir Verschlüsselte Emails senden wollt, findet ihr meinen **PGP-Key** (link: https://gist.github.com/DerZyklop/60cfc7259934037a2bf9 text: hier). Falls ihr euch fragt warum ihr das tun solltet, (link: http://der-zyklop.de/pxwrk/keine-verschluesselung/ text: lest das).
